                                    <div id="pnlContent" class="content">
                                       <p>To create a dyad schedule, select Dyad Schedule from the Select schedule type drop-down menu.</p>
                                       <p><img alt="" style="width: 200px;" src="../../../images/class/7-select schedule type.png"></p>
                                       <p><strong>Note:</strong> The first time a dyad schedule is created, there will not be a schedule template to select in the Select schedule template drop-down menu. After one dyad schedule has been created, you will be able to use this as a template for more dyad schedules.</p>
                                       <p>First you must define your dyads in the Define Dyads section.<br>
                                          <br>
                                          <img alt="" src="../../../images/class/Dyad01b.png" style="width: 500px;">
                                       </p>
                                       <p><strong>Note:</strong> A Pitsco representative should have provided you with a list of Modules grouped into pairs, or dyads. You will need this list to complete this step.</p>
                                       <p>Click Add a dyad to this schedule to begin.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/Dyad01a.png"></p>
                                       <p>Name the dyad in the Dyad field and select the Modules in the dyad from the Module column drop-down menus.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad2.png"></p>
                                       <p>Click the wand icon to save the dyad and click Add a dyad to this schedule to continue adding Module dyads.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad3.png"></p>
                                       <p>After you have defined all dyads, you can begin scheduling the instruction. <strong>Note:</strong> We recommend you have your school calendar available.</p>
                                       <p>Here are the recommended lengths of time for Pitsco Science Stage Activities (teacher-led instruction):</p>
                                       <ul>
                                          <li>Stage 1 – 5 days with 45-minute class periods (225 minutes)</li>
                                          <li>Stage 2 – 5 days with 45-minute class periods (225 minutes)</li>
                                          <li>Stage 3 – 7 days with 45-minute class periods (315 minutes)</li>
                                          <li>Stage 4 – 7 days with 45-minute class periods (315 minutes)</li>
                                          <li>Stage 5 – 10 to 15 days with 45-minute class periods (450-675 minutes)</li>
                                       </ul>
                                       <p>Click the pencil icon to specify details. The Instruction Stage section will appear.</p>
                                       <p><img alt="" style="width: 100px;" src="../../../images/class/pencil.png"></p>
                                       <p>Fields are auto-populated based on the stage selected, but you can edit the start date and end date as necessary. Click Save Instruction when complete.</p>
                                       <p><strong>Note:</strong> It is best to begin with the Stage 1 Activity and work your way down through the schedule. Make sure to add additional days for holidays, early release days, and so on as necessary in the schedule.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad4.png"></p>
                                       <p>Make sure to select Orientation Module from the Select Orientation type drop-down menu if you wish to schedule the <em>Orientation</em> Module.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad5.png"></p>
                                       <p>When scheduling dyad rotations, you will need to select the number of rotations. Refer to your scope and sequence document to find out if you need to select two or four rotations.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad6.png"></p>
                                       <p>After you save the information for a dyad rotation, the details for the number of rotations selected will expand in the main view. To edit start or end dates of a rotation, click the pencil icon.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad7.png"></p>
                                       <p>To edit the number of rotations, simply click the number to change it. Clicking 2 in this example will change the number of rotations to 4.</p>
                                       <p><img alt="" style="width: 100px;" src="../../../images/class/dyad12.png"></p>
                                       <p>To save, click the wand icon.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad8.png"></p>
                                       <p>Continue clicking the pencil icon and setting dates for each section of the schedule. If you wish to skip or delete a portion of the schedule, click the trash can. A warning message will appear.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad9.png"></p>
                                       <p><img alt="" style="width: 200px;" src="../../../images/class/dyad10.png"></p>
                                       <p>Click View Schedule when you are ready to look at your schedule. <strong>Note:</strong> If the number of Modules does not equal the number of rotations, a warning message will appear.</p>
                                       <p><img alt="" style="width: 200px;" src="../../../images/class/dyad11.png"></p>
                                       <p>Your class schedule will appear.</p>
                                       <p><img alt="" style="width: 500px;" src="../../../images/class/dyad13.png"></p>
                                       <p>Manual adjustments can be made to the schedule. To remove a student from a schedule, hover your mouse pointer over the student's name to highlight it. Click the X to remove the student.</p>
                                       <p><img alt="" src="../../../images/class/dyad14b.jpg" style="width: 350px;"></p>
                                       <p>If you have an empty cell and want to move a student to that cell, click the cell and the student list will appear. A warning message will appear if the selection causes a conflict.</p>
                                       <p><img alt="" style="width: 350px;" src="../../../images/class/dyad15.png"></p>
                                       <p>Click Regenerate to have <em>Synergy</em> regenerate a different schedule. Click Save Instruction to save.</p>
                                       <p><img alt="" style="width: 300px;" src="../../../images/class/dyad16.png"></p>
